__NUXT_JSONP__("/svet/stat/bosna-a-hercegovina/ceny", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q){return {data:[{tabsLoad:{tabWhatToSee:b,tabPrice:b,tabPeople:b,tabTrip:b,tabContact:b,tabHotel:b,tabNeighboring:c,tabVideos:c,tabArticles:c,tabWallSockets:h,tabChains:d,tabFauna:c,tabFlora:c,tabFoods:c,tabBrands:c},place:[{tld:".ba",name:"Bosna a Hercegovina",area:51209,population:3280815,slug:l,id_continent:f,information_chatgpt:"\u003Cp\u003EBosna a Hercegovina je země ležící v jihovýchodní Evropě, na Balkánském poloostrově. Sousedí s Chorvatskem, Srbskem a Černou Horou. Hlavním městem je Sarajevo, které je známé svou historií, kulturou a překrásnou architekturou.\u003C\u002Fp\u003E\n\u003Cp\u003EBosna a Hercegovina má bohatou historii, která sahá až do doby před římskou říší. V minulosti byla součástí Osmanské říše a Rakousko-Uherska. Díky tomu má země jedinečnou směsici kultur a tradic. \u003C\u002Fp\u003E\n\u003Cp\u003EKromě toho, že je Bosna a Hercegovina kulturně a historicky velmi bohatá, má také mnoho přírodních krás. Mezi nejznámější patří Národní park Una, který se nachází na severozápadě země a nabízí úchvatné scenérie řek, vodopádů a lesů. Další přírodní krásou jsou vodopády Kravica, které se nacházejí v jižní části země. \u003C\u002Fp\u003E\n\u003Cp\u003EPro turisty je zajímavým místem také město Mostar, které je známé svým klenutým mostem a historickými budovami. Dalším turistickým cílem je například město Jajce, které má bohatou historii a nachází se zde vodopád, který je považován za jeden z nejkrásnějších v Evropě. \u003C\u002Fp\u003E\n\u003Cp\u003EBosna a Hercegovina je také známá svými tradičními pokrmy, jako je například čevapi, pljeskavica a burek, což jsou různé druhy masových a pečených jídel. Kromě toho má země také silnou kávovou kulturu a mnoho kaváren, kde se dá ochutnat tradiční bosenská káva. \u003C\u002Fp\u003E\n\u003Cp\u003ENavzdory své bohaté historii a turistickým atrakcím má Bosna a Hercegovina také své problémy, včetně politické nestability a národnostních napětí. Přesto je země stále oblíbeným cílem pro turisty, kteří hledají kombinaci historie, kultury a krásné přírody.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:2.5,date_update:a},{name:"Hlavní jídlo",value:15,date_update:a},{name:"Chleba",value:d,date_update:a},{name:"Mléko",value:i,date_update:a},{name:"Voda (500ml)",value:d,date_update:a},{name:"Espresso",value:i,date_update:a},{name:"Zmrzlina (jeden kopeček)",value:i,date_update:a},{name:"Pivo",value:h,date_update:a},{name:"Krabička cigaret",value:j,date_update:a},{name:"Bic Mac",value:6,date_update:a},{name:"Coca Cola (500ml)",value:h,date_update:a}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:a},{name:"Policie",value:"122",date_update:a},{name:"Hasiči",value:"123",date_update:a},{name:"Zdravotnická záchranná služba",value:"124",date_update:a},{name:"Turistická policie",value:"128",date_update:a}],phone_prefix:"+387",coordinates:[{latitude:"43.9159",longitude:"17.6791"}],people_religion:[{name:"Islám",value:"50.7%"},{name:"Křesťanství",value:"44.5%"},{name:"Ostatní",value:"1.3%"},{name:"Bez vyznání",value:"3.5%"}],people_nationality:[],visitors_entry:[{name:"Občanský průkaz",value:"I přes to že Bosna a Hercegovina není členem evropské unie, tak evropský občanský průkaz je dostateční pro vstup do země. I tak je samozřejmě doporučeno mít sebou cestovní pas.",date_update:m},{name:"Cestovní pas",value:"Pro vstup do Bosny a Hercegoviny není nutné mít cestovní pas pro majitele evropského občanského průkazu avšak stále je doporučeno mít platný cestovní pas. Pas musí být platný alespoň po dobu pobytu v zemi.",date_update:m},{name:"Vízum",value:"Pro vstup do Bosny a Hercegoviny není potřeba vízum pro občany zemí Evropské unie a Švýcarska. Pobyt může trvat až 90 dnů během 180denního období.",date_update:e},{name:"Očkování",value:"Pro vstup do Bosny a Hercegoviny není vyžadováno žádné specifické očkování. Nicméně, doporučuje se zkontrolovat očkování proti běžným chorobám, jako jsou tetanus, záškrt a spála.",date_update:e},{name:"Cestovní pojištění",value:"Pojištění není povinné, ale doporučuje se mít cestovní pojištění na celou dobu pobytu.",date_update:e},{name:"Bezpečnostní situace",value:"V Bosně a Hercegovině se vyskytují bezpečnostní rizika v souvislosti s kriminalitou, terorismem a politickou nestabilitou. Je třeba být obezřetný a informovat se o aktuální situaci před cestou.",date_update:e},{name:"Další informace",value:"V Bosně a Hercegovině je běžná platba hotově. Místní měna je konvertibilní marka (BAM). V zemi je také běžné dávat spropitné. Místní lidé jsou obvykle přátelští a pohostinní.",date_update:e}],type_place:n,id_image_cover:k,id_image_hero:k,id_city_main:151,affiliate:[{name:"booking",value:b}],mpz:"BA",alerts:[],zoom:[{google:o,booking:o}],ids_neighboring_countries:[],organization:[],apps:[],links:[],information_author:[{text:"\u003Cp\u003EBosna a Hercegovina je země ležící v jihovýchodní Evropě, na \u003Cb\u003EBalkánském poloostrově\u003C\u002Fb\u003E. Sousedí s \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fchorvatsko\"\u003EChorvatskem\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsrbsko\"\u003ESrbskem\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcerna-hora\"\u003EČernou Horou\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Hlavním městem je \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsarajevo\"\u003ESarajevo\u003C\u002Fa\u003E\u003C\u002Fb\u003E, které je známé svou historií, kulturou a překrásnou architekturou.\u003C\u002Fp\u003E\u003Cp\u003EBosna a Hercegovina má bohatou historii, která sahá až do doby před římskou říší. V minulosti byla součástí Osmanské říše a Rakousko-Uherska. Díky tomu má země jedinečnou směsici kultur a tradic.\u003C\u002Fp\u003E\u003Ch3\u003EHistorie a Kultura\u003C\u002Fh3\u003E\u003Cp\u003EBosna a Hercegovina byla historicky domovem různých etnických skupin, což ovlivnilo její bohatou kulturu. V Sarajevu, hlavním městě, se střetávají různé architektonické styly, od osmanských paláců až po rakousko-uherské budovy. \u003Cb\u003EMostar\u003C\u002Fb\u003E, známý svým Starým mostem, je příkladem harmonického spojení mezi islámskou a křesťanskou kulturou.\u003C\u002Fp\u003E\u003Ch3\u003EPřírodní Památky a Národní Parky\u003C\u002Fh3\u003E\u003Cp\u003EBosna a Hercegovina nabízí ohromující scenérie pro příznivce přírody. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmisto\u002Fnarodni-park-una\"\u003ENárodní park Una\u003C\u002Fa\u003E\u003C\u002Fb\u003E, známý svými vodopády, poskytuje jedinečný zážitek. Vysoké hory \u003Cb\u003EDinárských Alp\u003C\u002Fb\u003E, s nejvyšší horou v zemi \u003Cb\u003EBosanski Maglić\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Ch3\u003EMěsta a Turistické Perly\u003C\u002Fh3\u003E\u003Ch4\u003ESarajevo\u003C\u002Fh4\u003E\u003Cp\u003E\u003Cb\u003ESarajevo\u003C\u002Fb\u003E, hlavní město, je klenotem spojujícím různé kultury. Staré město \u003Cb\u003EBaščaršija\u003C\u002Fb\u003E s úzkými uličkami a trhy nabízí autentický zážitek. \u003Cb\u003ELatinska ćuprija\u003C\u002Fb\u003E a Sarajevská radnice, připomínají kulturní rozmanitost.\u003C\u002Fp\u003E\u003Ch4\u003EMostar\u003C\u002Fh4\u003E\u003Cp\u003EMostar, s ikonickým Starým mostem přes řeku Neretvu, je považován za perlu Bosny a Hercegoviny. Most, postavený v 16. století, je nejen architektonickým skvostem, ale také místem, kde se setkávají různé kultury.\u003C\u002Fp\u003E\u003Ch3\u003EArchitektura a Historické Památky\u003Ch3\u003E\u003Ch4\u003EMostarův Starý Most\u003C\u002Fh4\u003E\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmisto\u002Fstary-most-mostar\"\u003EStarý most v Mostaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E, vysoký 24 metrů, byl postaven Osmany v roce 1566. Jeho oblouk nad řekou \u003Cb\u003ENeretvou\u003C\u002Fb\u003E je symbolickým spojením islámského a křesťanského světa.\u003C\u002Fp\u003E\u003Ch4\u003EVijećnica v Sarajevu\u003C\u002Fh4\u003E\u003Cp\u003E\u003Cb\u003ESarajevská radnice (Vijećnica)\u003C\u002Fb\u003E, postavená v novogotickém stylu v roce 1891, Stavbu Navrhl český architekt Karel Pařík. sloužila původně jako radnice. Dnes je to národní knihovna, památník zasvěcený kulturní a historické hodnotě města a nadále využívá jí státní správa.\u003C\u002Fp\u003E\u003Ch3\u003EDoprava a Cestování\u003C\u002Fh3\u003E\u003Cp\u003ECestování Bosnou a Hercegovinou je jedinečným zážitkem. Silnice nabízejí malebná panoramata, ale mohou být v některých oblastech výzvou. Veřejná doprava, zejména autobusy a vlaky, spojují města. \u003Cb\u003ELetiště Sarajevo (SJJ)\u003C\u002Fb\u003E je hlavním vstupním bodem pro mezinárodní návštěvníky.\u003C\u002Fp\u003E\u003Ch3\u003EKulinářské Lahůdky\u003C\u002Fh3\u003E\u003Cp\u003EBosenská kuchyně odráží kulturní směsici země. \u003Cb\u003EČevapi\u003C\u002Fb\u003E, malé mleté masové kuličky, jsou populárním pokrmem, stejně jako \u003Cb\u003EBurek\u003C\u002Fb\u003E, vrstvené pečivo plněné masem nebo sýrem. Tradiční káva je nezbytným doplňkem po chutné večeři.\u003C\u002Fp\u003E",date_create:p,date_update:p,author_create:g,author_update:g}],seo_tags:[],language_phrases:[],wall_sockets:null,id:17,facts_place:[],created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-04T19:48:12.84066+00:00",name_original:"Босна и Херцеговина",currency:[{code:"BAM",name:"konvertibilní marka"}],setting_top:b,setting_status_public:d}],imagePlace:[{id:k,name:l,source:"\u002Fworld\u002Fstates\u002F",type:n,author:"pixabay.com",created_at:"2023-04-10T23:52:54.61888+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:f,slug:"evropa",name:"Evropa",area:10180000,population:746000000,population_density:73.22,number_states:44,information_chatgpt:"\u003Cp\u003EEvropa je druhým nejmenším kontinentem na světě, ale zároveň se jedná o jednu z nejvíce rozmanitých oblastí na planetě. Nachází se zde mnoho historických a kulturních památek, překrásných přírodních scenérií a mnoho dalších atrakcí, což z ní dělá jednu z nejnavštěvovanějších turistických destinací na světě.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa má dlouhou a bohatou historii. Na kontinentě se odehrály mnohé důležité události, jako například římská říše, středověké křížové výpravy, renesance, průmyslová revoluce a dvě světové války. Tato historie se odráží v architektuře, muzeích a dalších kulturních památkách, které jsou na kontinentu k vidění.\u003C\u002Fp\u003E\n\u003Cp\u003EV Evropě se nachází mnoho zajímavých měst. Například Paříž, Londýn, Řím, Barcelona, Praha, Berlín a Amsterdam jsou velmi oblíbenými cíli turistů. Tyto města nabízejí nejen historické památky, ale také vynikající kuchyni, noční život a mnoho možností pro nákupy.\u003C\u002Fp\u003E\n\u003Cp\u003EPřírodní krása Evropy je také úžasná. Nachází se zde krásné pláže, hory, řeky a jezera. Alpské hory nabízejí překrásné scenérie, skvělé podmínky pro lyžování a další outdoorové aktivity. Národní parky, jako třeba Plitvická jezera v Chorvatsku, Krkonošský národní park v České republice nebo Národní park Durmitor v Černé Hoře, jsou dalšími příklady nádherných přírodních scenérií, které stojí za návštěvu.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa také nabízí širokou škálu kulturních aktivit. Existují zde mnohé umělecké festivaly, výstavy, divadelní představení a koncerty, které jsou pořádány po celém kontinentu. Mnoho měst také pořádá tradiční slavnosti a jarmarky, kde se můžete seznámit s místními tradicemi a kulturou.\u003C\u002Fp\u003E\n\u003Cp\u003EPři návštěvě Evropy si určitě nenechte ujít místní kuchyni. Každá země má své vlastní speciality a chuťě\u003C\u002Fp\u003E\u003Cp\u003EMezi nejznámější evropské kuchyně patří italská, francouzská a španělská. Italská kuchyně je známá svými těstovinami, pizzou a zmrzlinou. Francouzská kuchyně nabízí širokou škálu různých pokrmů, jako například sýry, pečivo, maso a víno. Španělská kuchyně je známá svými tapas, paellou a sangriou. Kromě těchto kuchyní jsou v Evropě také velmi oblíbené pokrmy jako německé klobásy, anglické snídaně, holandský sýr a mnoho dalšího.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa také nabízí mnoho možností pro sportovní aktivity. Mezi nejpopulárnější sporty patří fotbal, hokej, tenis a cyklistika. Na kontinentu se také nachází mnoho golfových hřišť, lyžařských středisek a dalších sportovních zařízení. V posledních letech se stále více lidí zajímá o ekoturistiku, a tak se nabízí možnost podniknout pěší túru nebo cyklistický výlet a objevovat krásy evropské přírody.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa je jedním z nejlepších míst pro cestování, nabízí mnoho možností pro každého cestovatele. Díky rozmanitosti kontinentu si každý najde to svoje, co ho zaujme. Záleží pouze na vás, zda si zvolíte kulturní zážitky, přírodní krásy, sportovní aktivity nebo si jen tak užijete místní kuchyni a pohodu.\u003C\u002Fp\u003E",coordinates:[{latitude:47.497912,longitude:19.040235}],type_place:"continent",id_image_cover:f,id_image_hero:f,zoom:[{google:j,booking:j}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E je druhým nejmenším kontinentem na světě, ale zároveň se jedná o jednu z nejvíce rozmanitých oblastí na planetě. Nachází se zde mnoho historických a kulturních památek, překrásných přírodních scenérií a mnoho dalších atrakcí, což z ní dělá jednu z nejnavštěvovanějších turistických destinací na světě.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E má dlouhou a bohatou historii. Na kontinentě se odehrály mnohé důležité události, jako například římská říše, středověké křížové výpravy, renesance, průmyslová revoluce a dvě světové války. Tato historie se odráží v architektuře, muzeích a dalších kulturních památkách, které jsou na kontinentu k vidění.\u003C\u002Fp\u003E\n\u003Cp\u003EV \u003Cb\u003EEvropě\u003C\u002Fb\u003E se nachází mnoho zajímavých měst. Například \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fpariz\"\u003EPaříž\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Flondyn\"\u003ELondýn\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Frim\"\u003EŘím\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbarcelona\"\u003EBarcelona\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fpraha\"\u003EPraha\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fberlin\"\u003EBerlín\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Famsterdam\"\u003EAmsterdam\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou velmi oblíbenými cíli turistů. Tyto města nabízejí nejen historické památky, ale také vynikající kuchyni, noční život a mnoho možností pro nákupy.\u003C\u002Fp\u003E\n\u003Cp\u003EPřírodní krása \u003Cb\u003EEvropy\u003C\u002Fb\u003E je také úžasná. Nachází se zde krásné pláže, hory, řeky a jezera. \u003Cb\u003EAlpské hory\u003C\u002Fb\u003E nabízejí překrásné scenérie, skvělé podmínky pro lyžování a další outdoorové aktivity. Národní parky, jako třeba \u003Cb\u003EPlitvická jezera\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fchorvatsko\"\u003EChorvatsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003EKrkonošský národní park\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcesko\"\u003EČeské republice\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ENárodní park Durmitor\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcerna-hora\"\u003EČerné Hoře\u003C\u002Fa\u003E\u003C\u002Fb\u003E, jsou dalšími příklady nádherných přírodních scenérií, které stojí za návštěvu.\u003C\u002Fp\u003E\n  \u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E také nabízí širokou škálu kulturních aktivit. Existují zde mnohé umělecké festivaly, výstavy, divadelní představení a koncerty, které jsou pořádány po celém kontinentu. Mnoho měst také pořádá tradiční slavnosti a jarmarky, kde se můžete seznámit s místními tradicemi a kulturou.\u003C\u002Fp\u003E\n  \u003Cp\u003EPři návštěvě \u003Cb\u003EEvropy\u003C\u002Fb\u003E si určitě nenechte ujít místní kuchyni. Každá země má své vlastní speciality a chuťě\u003C\u002Fp\u003E\u003Cp\u003EMezi nejznámější evropské kuchyně patří \u003Cb\u003Eitalská\u003C\u002Fb\u003E, \u003Cb\u003Efrancouzská\u003C\u002Fb\u003E a \u003Cb\u003Ešpanělská\u003C\u002Fb\u003E. \u003Cb\u003EItalská kuchyně\u003C\u002Fb\u003E je známá svými \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpasta\"\u003Etěstovinami\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpizza\"\u003Epizzou\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003Ezmrzlinou\u003C\u002Fb\u003E. \u003Cb\u003EFrancouzská kuchyně\u003C\u002Fb\u003E nabízí širokou škálu různých pokrmů, jako například sýry, pečivo, maso a víno. \u003Cb\u003EŠpanělská kuchyně\u003C\u002Fb\u003E je známá svými \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Ftapas\"\u003Etapas\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpaella\"\u003Epaellou\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003Esangriou\u003C\u002Fb\u003E. Kromě těchto kuchyní jsou v \u003Cb\u003EEvropě\u003C\u002Fb\u003E také velmi oblíbené pokrmy jako \u003Cb\u003Eněmecké klobásy\u003C\u002Fb\u003E, \u003Cb\u003Eanglické snídaně\u003C\u002Fb\u003E, \u003Cb\u003Eholandský sýr\u003C\u002Fb\u003E a mnoho dalšího.\u003C\u002Fp\u003E\n  \u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E také nabízí mnoho možností pro sportovní aktivity. Mezi nejpopulárnější sporty patří fotbal, hokej, tenis a cyklistika. Na kontinentu se také nachází mnoho golfových hřišť, lyžařských středisek a dalších sportovních zařízení. V posledních letech se stále více lidí zajímá o ekoturistiku, a tak se nabízí možnost podniknout pěší túru nebo cyklistický výlet a objevovat krásy evropské přírody.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E je jedním z nejlepších míst pro cestování, nabízí mnoho možností pro každého cestovatele. Díky rozmanitosti kontinentu si každý najde to svoje, co ho zaujme. Záleží pouze na vás, zda si zvolíte kulturní zážitky, přírodní krásy, sportovní aktivity nebo si jen tak užijete místní kuchyni a pohodu.\u003C\u002Fp\u003E",date_create:q,date_update:q,author_create:g,author_update:g}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-04T19:48:06.634661+00:00",name_original:"Europe",setting_top:b,setting_status_public:d}]}],fetch:{},mutations:[]}}("05-2023",true,0,1,"04-2023",4,"1",2,1.5,3,24,"bosna-a-hercegovina","12-2023","state",7,"2024-02-24","2024-02-07")));